pragma solidity >=0.5.0 <0.6.0;

import { DSProxy } from './lib/dappsys-monolithic/proxy.sol';
import { ISaiTub as SaiTub } from './lib/sai/ITub.sol';
import { ProxyRegistry } from './lib/sai/ProxyRegistry.sol';

import './DeftyWrap.sol';

contract DeftyProxyWrap is DeftyWrap {
  address proxyRegistryAddress;

  constructor(address tubAddress_, address proxyRegistryAddress_)
    DeftyWrap(tubAddress_)
    public
  {
    proxyRegistryAddress = proxyRegistryAddress_;
  }

  function proveProxyOwnership(bytes32 cup, address proxy)
    public
    returns (bool)
  {
    SaiTub untrustedMkr = SaiTub(tubAddress);
    DSProxy untrustedSaiProxy = DSProxy(address(uint160(proxy)));
    address owner = untrustedSaiProxy.owner();

    // and if the proxy is the owner of the cup
    require(untrustedMkr.lad(cup) == proxy, 'The msg.sender is not the owner of the CDP');
    // if owner is authorized to use the proxy
    require(owner == msg.sender, 'Unauthorised, msg.sender is not the authorized to use this proxy');

    proofRegistery[cup].cup = cup;
    proofRegistery[cup].lad = msg.sender;
    proofRegistery[cup].state = WrapState.Proved;

    emit Proved(msg.sender, cup, proofRegistery[cup].state);
    return true;
  }

  function unwrapToProxy(uint256 nft)
    public
    returns (bool) {
      SaiTub untrustedTub = SaiTub(tubAddress);
      ProxyRegistry untrustedProxyRegistry = ProxyRegistry(proxyRegistryAddress);

      DSProxy proxy = untrustedProxyRegistry.proxies(address(msg.sender));

      /* if (!proxy) { return false; } */

      /* DSProxy untrustedDSProxy = DSProxy(address(uint160(proxy))); */
      address owner = proxy.owner();
      bytes32 cup = cdpRegistry[nft];

      require(owner == msg.sender, 'Unauthorised, msg.sender is not the authorized to use this proxy');
      require(msg.sender == ownerOf(nft), 'Only the DYT owner can unwrap the NFT');
      untrustedTub.give(cup, msg.sender);

      _burn(nft);
      cdpRegistry[nft];
      proofRegistery[cup].state = WrapState.Unwrapped;




      // Should emit a specific event and say that we gave it to a proxy.
      emit Unwrapped(msg.sender, cup, nft);
  }

}
